const overlayMatrices = $.generateMatrixRotations([1, 0, 1, 0, 1, 0, 1, 0, 1]);

class PlanterComponent extends $.Component {
    static getId() {
        return "Planter";
    }
    
    constructor({ type = $.defaultBuildingVariant }) {
        super();
        this.type = type;
    }
}

class HUDPlanterChime extends $.BaseHUDPart {
    initialize() {
        this.root.camera.downPreHandler.add(this.downPreHandler, this);
    }
    
    downPreHandler(pos, button) {
        const tile = this.root.camera.screenToWorld(pos).toTileSpace();
        const contents = this.root.map.getLayerContentXY(tile.x, tile.y, "regular");
        if (contents?.components.Planter) {
            if (button === $.enumMouseButton.left) {
                if (contents.components.Planter.type === enumPlanterVariants.logo) {
                    this.root.soundProxy.playUi($.SOUNDS.badgeNotification);
                } else {
                    this.root.soundProxy.playUi($.SOUNDS.dialogOk);
                }
                
            } else if (button === $.enumMouseButton.right) {
                if (!this.root.hud.parts.buildingPlacer.currentMetaBuilding) {
                    this.root.logic.tryDeleteBuilding(contents);
                }
                return $.STOP_PROPAGATION;
            }
        }
    }
}

